import React from 'react'
import Link from 'next/link';
import { Button } from 'antd';
import "../style/index.css"
const wasm = import('wasm/a.out.wasm')
import Luna from '../components/Luna'
class Juicy extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div>
        <p className="mona">Hey jude</p>
        <Button type="primary">hey Jude</Button>
        <div>
          <Link href='/about' ><a>about page</a></Link>
        </div>
        <Luna/>
        <style jsx>{
          `
          .mona{
            color:blue
          }
          `
        }</style>
      </div>
    )
  }
  componentDidMount(){
    console.log("mounted!")
    console.log(wasm)
  }
}
export default Juicy
